import { CustomerData } from '../types/customer';

class GoogleSheetsService {
  private spreadsheetId: string;
  private apiKey: string;
  private clientEmail: string;
  private privateKey: string;

  constructor() {
    this.spreadsheetId = process.env.REACT_APP_SPREADSHEET_ID || '';
    this.apiKey = process.env.REACT_APP_GOOGLE_API_KEY || '';
    this.clientEmail = process.env.REACT_APP_GOOGLE_CLIENT_EMAIL || '';
    this.privateKey = process.env.REACT_APP_GOOGLE_PRIVATE_KEY || '';
  }

  async getCustomers(): Promise<CustomerData[]> {
    // 本番環境ではGoogle Sheets APIから直接データを取得
    if (process.env.NODE_ENV === 'production' && this.spreadsheetId && this.apiKey) {
      try {
        return await this.fetchFromGoogleSheets();
      } catch (error) {
        console.error('Google Sheets API エラー:', error);
        return this.getMockCustomers();
      }
    }
    
    // 開発環境ではモックデータを返す
    return this.getMockCustomers();
  }

  private async fetchFromGoogleSheets(): Promise<CustomerData[]> {
    try {
      console.log('Google Sheets API 設定:', {
        spreadsheetId: this.spreadsheetId,
        apiKey: this.apiKey ? '設定済み' : '未設定',
        environment: process.env.NODE_ENV
      });

      // Google Sheets API v4を使用してデータを取得
      const url = `https://sheets.googleapis.com/v4/spreadsheets/${this.spreadsheetId}/values/Sheet1?key=${this.apiKey}`;
      console.log('API URL:', url);
      
      const response = await fetch(url);
      
      console.log('API レスポンス:', {
        status: response.status,
        statusText: response.statusText,
        ok: response.ok
      });
      
      if (!response.ok) {
        const errorText = await response.text();
        console.error('API エラーレスポンス:', errorText);
        throw new Error(`HTTP error! status: ${response.status}, message: ${errorText}`);
      }
      
      const data = await response.json();
      console.log('取得したデータ:', data);
      
      const parsedData = this.parseSheetData(data.values || []);
      console.log('解析されたデータ:', parsedData);
      
      return parsedData;
    } catch (error) {
      console.error('Google Sheets データ取得エラー:', error);
      throw error;
    }
  }

  private parseSheetData(values: string[][]): CustomerData[] {
    if (values.length < 2) {
      return [];
    }

    // ヘッダー行をスキップしてデータを解析
    const headers = values[0];
    const dataRows = values.slice(1);

    return dataRows.map((row, index) => {
      // ヘッダーに基づいてデータをマッピング
      const getValue = (headerName: string) => {
        const headerIndex = headers.findIndex(h => h.toLowerCase().includes(headerName.toLowerCase()));
        return headerIndex >= 0 ? row[headerIndex] || '' : '';
      };

      return {
        id: getValue('id') || `C${String(index + 1).padStart(3, '0')}`,
        name: getValue('name') || getValue('名前') || '',
        petName: getValue('pet') || getValue('ペット') || getValue('petname') || '',
        email: getValue('email') || getValue('メール') || '',
        phone: getValue('phone') || getValue('電話') || getValue('tel') || '',
        address: getValue('address') || getValue('住所') || '',
        petType: (getValue('type') || getValue('種類') || 'その他') as '犬' | '猫' | 'その他',
        breed: getValue('breed') || getValue('品種') || '',
        age: parseInt(getValue('age') || getValue('年齢') || '0') || 0,
        weight: parseFloat(getValue('weight') || getValue('体重') || '0') || 0,
        imageUrl: getValue('image') || getValue('画像') || '',
        notes: getValue('notes') || getValue('備考') || getValue('memo') || '',
        createdAt: getValue('created') || getValue('登録日') || new Date().toISOString().split('T')[0],
        lastVisit: getValue('lastvisit') || getValue('最終来店') || '',
        status: (getValue('status') || getValue('ステータス') || 'active') as 'active' | 'inactive'
      };
    }).filter(customer => customer.name && customer.petName); // 名前とペット名があるもののみ
  }

  async getCustomerById(id: string): Promise<CustomerData | null> {
    const customers = await this.getCustomers();
    return customers.find(customer => customer.id === id) || null;
  }

  // モックデータ（開発用）
  getMockCustomers(): CustomerData[] {
    return [
      {
        id: 'C001',
        name: '田中太郎',
        petName: 'ポチ',
        email: 'tanaka@example.com',
        phone: '090-1234-5678',
        address: '東京都渋谷区',
        petType: '犬',
        breed: '柴犬',
        age: 3,
        weight: 8.5,
        imageUrl: 'https://via.placeholder.com/150',
        notes: '人懐っこい性格',
        createdAt: '2024-01-15',
        lastVisit: '2024-01-20',
        status: 'active'
      },
      {
        id: 'C002',
        name: '佐藤花子',
        petName: 'ミケ',
        email: 'sato@example.com',
        phone: '090-9876-5432',
        address: '東京都新宿区',
        petType: '猫',
        breed: 'アメリカンショートヘア',
        age: 2,
        weight: 4.2,
        imageUrl: 'https://via.placeholder.com/150',
        notes: '少し臆病',
        createdAt: '2024-01-10',
        lastVisit: '2024-01-18',
        status: 'active'
      },
      {
        id: 'C003',
        name: '山田次郎',
        petName: 'ハナ',
        email: 'yamada@example.com',
        phone: '090-5555-1234',
        address: '東京都世田谷区',
        petType: '犬',
        breed: 'ゴールデンレトリバー',
        age: 5,
        weight: 25.0,
        imageUrl: 'https://via.placeholder.com/150',
        notes: 'とても活発',
        createdAt: '2024-01-05',
        lastVisit: '2024-01-12',
        status: 'active'
      }
    ];
  }
}

export default GoogleSheetsService;
